import { Container } from "react-bootstrap";
import TolkienLink from "https://www.tolkienestate.com/life/biography/";

export function Home() {
    return (
      <main id="Home">
        <Container>
          <h1>For Frodo!</h1>
          <p>The Lord Of The Rings and everything that <a href={TolkienLink} target="_blank">J.R.R. Tolkien</a> created are amazing. Tolkien created his own language, then, created epic high-fantasy stories with it.</p>
          <p>This website is intented to showcase his works and as a fan myself, I am very fond of it.</p>
          If you want to check out how I designed it, please pay a visit to my GitHub account!
          Thank you!

        </Container>
      </main>
    );
  }
